import { StyleSheet } from "react-native-web";

export const s = StyleSheet.create({
  headerContainer: {
    alignItems: "center",
    marginBottom: 20,
  },
  img: {
    width: 120,
    height: 40,
  },
  subtitle: {
    fontSize: 20,
    color: "#ABABAB",
  },
});
